import { TextField } from '@material-ui/core';

export default function SignUpForm() {
  return(
    <form noValidate autoComplete="off">
    <TextField
          id="standard-full-width"
          label="username"
          style={{ margin: 8 }}
          placeholder="@jim"
          fullWidth
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
        />      
       <TextField 
          type="password"
          id="standard-full-width"
          label="password"
          style={{ margin: 8 }}
          placeholder="***********"
          fullWidth
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
        />  
        <TextField
          type="password"
          id="standard-full-width"
          label="email"
          style={{ margin: 8 }}
          placeholder="jack@chitter.com"
          fullWidth
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
        />  
    </form>
  )
}
